import axios from 'axios'

const apiUrl = process.env.VUE_APP_API_URL || '/api'

const api = axios.create({
  baseURL: apiUrl,
  headers: {
    'Content-Type': 'application/json',
    'Accept': 'application/json'
  }
})

export default api
